import React, {Component} from 'react';
import './App.css';
import HealRequestForm from './HealRequestForm';
import Instructions from './Instructions';
import Footer from './Footer';
import NavComponent from './Nav';
import Ask_Send from './Ask_Send';

class App extends Component {



  render(){
  return (
    <div className="App">
      <header className="App-header">
        <NavComponent />
      </header>
      <div className="instructions container">
        <Instructions />
      </div>
      <div className="heal-request container">
      <HealRequestForm  />
      </div>
      <div className="ask-send container">
        <AskSend />
        </div>
        <div className="footer container">
      <Footer />
      </div>
    </div>
  );
}
};

export default App;
